import { BrowserRouter, Routes, Route, Outlet, Link} from 'react-router-dom';

function HomePage(){
  return(
    <h1>Home</h1>
  )
}

function AboutUsPage(){
  return(
    <h1>About us</h1>
  )
}

function TaskBaordPage(){
  return(
    <h1>Task Board</h1>
  )
}

function ManageTaskPage(){
  return(
    <h1>Manage Task</h1>
  )
}

function CreateTaskPage(){
  return(
    <h1>Create Task</h1>
  )
}

function LoginPage(){
  return(
    <h1>Login</h1>
  )
}

function SignupPage(){
  return(
    <h1>Signup</h1>
  )
}

function NoPage(){
  return(
    <h1>No Page found</h1>
  )
}

function AppLayout() {
  return (
    <>
    <nav>
            <Link to='/'>Home</Link> | 
            <Link to='about-us'>About us</Link> | 
            <Link to='task-board'>Task Board</Link>
            <Link to='manage-task'>Manage Task</Link>
            <Link to='login'>Login</Link> | 
            <Link to='signup'>Signup</Link>
          </nav>
          <Outlet/>
    </>
  )
}

function App() {
  return (
        <BrowserRouter>
          <Routes>
            <Route path='/' element={<AppLayout/>}>
                <Route index element={<HomePage/>}/>
                <Route path='about-us' element={<AboutUsPage/>}/>
                <Route path='task-baord' element={<TaskBaordPage/>}/>
                <Route path='manage-task' element={<ManageTaskPage/>}/>
                <Route path='login' element={<LoginPage/>}/>
                <Route path='signup' element={<SignupPage/>}/>
                <Route path='*' element={<NoPage/>}/>
            </Route>
          </Routes>
        </BrowserRouter>
  );
}

export default App;
